const types = [
    {
        name: "light rain",
        url: "../static/svg/rain.svg",
        color: "#C5C5C5",
        color2: "#858383",
    },
];
export default function ConvertSkies(sky) {
    const skyinfo = types.find((item) => {
        item.name == sky;
        return item;
    });
    return skyinfo;
}
